import styled from 'styled-components'

const StyledCard = styled.div`
  height: 50
  width: 33%;

  border: solid 3px #4b4b4b;
  border-radius: 5px;
  display: flex;
  flex-direction: column;

  img {
    width: 150px;
    height: 150px;
  }
`;


function ProjectCard({ title, image, url }) {
  return (
    <StyledCard>
      <a href={url}>
        <img src={image} />
      </a>
      <h2>{title}</h2>
    </StyledCard>
  );
}

export default ProjectCard;
